// components/AboutPage.js
import React from 'react';

function AboutPage() {
  return (
    <div className="text-center mt-4">
      <h1>About Us</h1>
      <p>We are dedicated to providing the best parcel management service for our customers.</p>
      <p>Our system helps you track, manage, and deliver your parcels efficiently and reliably.</p>
    </div>
  );
}

export default AboutPage;
